import React, { useState } from 'react';
import axios from 'axios';

const API_URL = process.env.REACT_APP_API_URL;

function App() {
  const [emailReg, setEmailReg] = useState('');
  const [passwordReg, setPasswordReg] = useState('');

  const [emailLogin, setEmailLogin] = useState('');
  const [passwordLogin, setPasswordLogin] = useState('');

  const [question, setQuestion] = useState('');
  const [askedQuestion, setAskedQuestion] = useState('');

  const [userId, setUserId] = useState('');
  const [userProfile, setUserProfile] = useState({});
  const [userQuestions, setUserQuestions] = useState([]);

  const handleRegister = async () => {
    try {
      const response = await axios.post(`${API_URL}/users`, {
        email: emailReg,
        password: passwordReg,
      });
      console.log('User registered:', response.data);
    } catch (error) {
      console.error('Error registering user:', error);
    }
  };

  const handleLogin = async () => {
    try {
      const response = await axios.post(`${API_URL}/auth/login`, {
        email: emailLogin,
        password: passwordLogin,
      });
      localStorage.setItem('accessToken', response.data.accessToken);
      console.log('User logged in:', response.data);
    } catch (error) {
      console.error('Error logging in:', error);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('accessToken');
    console.log('User logged out');
  };

  const handleAskQuestion = async () => {
    try {
      const accessToken = localStorage.getItem('accessToken');
      const response = await axios.post(
        `${API_URL}/questions`,
        { question },
        {
          headers: {
            Authorization: `Bearer ${accessToken}`,
          },
        }
      );
      console.log('Question asked:', response.data);
      setAskedQuestion(response.data.question);
    } catch (error) {
      console.error('Error asking question:', error);
    }
  };

  const handleFetchUserProfile = async (userId) => {
    try {
      const accessToken = localStorage.getItem('accessToken');
      const response = await axios.get(`${API_URL}/users/${userId}`, {
        headers: {
          Authorization: `Bearer ${accessToken}`,
        },
      });
      console.log('User profile:', response.data);
      setUserProfile(response.data);
    } catch (error) {
      console.error('Error fetching user profile:', error);
    }
  };

  const handleFetchUserQuestions = async (userId) => {
    try {
      const accessToken = localStorage.getItem('accessToken');
      const response = await axios.get(`${API_URL}/users/${userId}/questions`, {
        headers: {
          Authorization: `Bearer ${accessToken}`,
        },
      });
      console.log('User questions:', response.data);
      setUserQuestions(response.data);
    } catch (error) {
      console.error('Error fetching user questions:', error);
    }
  };

  return (
    <div className="App">
      <h1>User Registration</h1>
      <input
        type="text"
        placeholder="Email"
        value={emailReg}
        onChange={(e) => setEmailReg(e.target.value)}
      />
      <input
        type="password"
        placeholder="Password"
        value={passwordReg}
        onChange={(e) => setPasswordReg(e.target.value)}
      />
      <button onClick={handleRegister}>Register</button>

      <h1>User Login</h1>
      <input
        type="text"
        placeholder="Email"
        value={emailLogin}
        onChange={(e) => setEmailLogin(e.target.value)}
      />
      <input
        type="password"
        placeholder="Password"
        value={passwordLogin}
        onChange={(e) => setPasswordLogin(e.target.value)}
      />
      <button onClick={handleLogin}>Login</button>
      <button onClick={handleLogout}>Logout</button>

      <h1>Ask a Question</h1>
      <input
        type="text"
        placeholder="Question"
        value={question}
        onChange={(e) => setQuestion(e.target.value)}
      />
      <button onClick={handleAskQuestion}>Ask Question</button>
      {askedQuestion && <p>Asked Question: {askedQuestion}</p>}

      <h1>User Profile</h1>
      <input
        type="text"
        placeholder="User ID"
        value={userId}
        onChange={(e) => setUserId(e.target.value)}
      />
      <button onClick={() => handleFetchUserProfile(userId)}>Fetch User Profile</button>
      <div>
        {Object.keys(userProfile).length > 0 ? (
          <ul>
            {Object.entries(userProfile).map(([key, value]) => (
              <li key={key}>
                <strong>{key}:</strong> {value.toString()}
              </li>
            ))}
          </ul>
        ) : (
          <p>No user profile available</p>
        )}
      </div>

      <h1>User Questions</h1>
      <button onClick={() => handleFetchUserQuestions(userId)}>Fetch User Questions</button>
      {userQuestions && userQuestions.map((userQuestion, index) => (
        <div key={index}>

          <p><strong>Question {index+1}: </strong> {userQuestion.question}</p>
          <hr />
        </div>
      ))}
    </div>
  );
}

export default App;
